function gamegenerate() {
    setTimeout(() => {
        $("#auto_increment_number_div").hide();
        $('.loading-game').addClass('show');
        setTimeout(() => {
            hide_loading_game();

            $.ajax({
                url: '/game/new_game_generated',
                type: "POST",
                data: {
                    _token: hash_id
                },
                dataType: "json",
                success: function (result) {
                    stage_time_out = 1;
                    if (bet_array.length > 0) {
                        place_bet_now();
                    }
                    $.ajax({
                        url: '/game/currentlybet',
                        type: "POST",
                        data: {
                            _token: hash_id
                        },
                        dataType: "json",
                        success: function (intialData) {
                            info_data(intialData);
                        }
                    });
                    current_game_data = result;
                    hide_loading_game();
                    new_game_generated();
                    lets_fly_one();
                    lets_fly();
                    let currentbet = 0;
                    let a = 1.0;

                    $.ajax({
                        url: '/game/increamentor',
                        type: "POST",
                        data: {
                            _token: hash_id
                        },
                        dataType: "json",
                        success: function (data) {
                            currentbet = data.result;

                            $.ajax({
                                url: '/game/currentlybet',
                                type: "POST",
                                data: {
                                    _token: hash_id
                                },
                                dataType: "json",
                                success: function (intialData) {
                                    info_data(intialData);
                                }
                            });

                            let increamtsappgame; // Declare the interval variable

                            // Function to handle the incrementing logic
                            const incrementGame = () => {
                                if (a >= currentbet) {
                                    let res = parseFloat(a).toFixed(2);
                                    crash_plane(res);
                                    incrementor(res);
                                    gameover(res);
                                    $("#all_bets .mCSB_container").empty();

                                    $.ajax({
                                        url: '/game/my_bets_history',
                                        type: "POST",
                                        data: {
                                            _token: hash_id
                                        },
                                        dataType: "json",
                                        success: function (data) {
                                            $("#my_bet_list").empty();
                                            for (let $i = 0; $i < data.length; $i++) {
                                                let date = new Date(data[$i].created_at);
                                                let amount = data[$i].amount;
                                                let cashout_multiplier = data[$i].cashout_multiplier;
                                                let cashout_amount = parseFloat(amount * cashout_multiplier).toFixed(0);


                                                if(currency_symbol == 'UGX'){
                                                    cashout_amount = parseFloat(amount * cashout_multiplier * 28).toFixed(0);
                                                    amount = parseFloat(amount * 28).toFixed(0);
                                                }
                                                $("#my_bet_list").append(`
                                                <div class="list-items">
                                                    <div class="column-1 users fw-normal">
                                                        ${date.getHours()}:${date.getMinutes()}
                                                    </div>
                                                    <div class="column-2">
                                                        <button
                                                            class="btn btn-transparent previous-history d-flex align-items-center mx-auto fw-normal">${currency_symbol}
                                                            ${amount}
                                                        </button>
                                                    </div>
                                                    <div class="column-3">
                                                        <div class="bg3 custom-badge mx-auto">
                                                            ${cashout_multiplier}x</div>
                                                    </div>
                                                    <div class="column-4 fw-normal">${currency_symbol}
                                                        ${cashout_amount}
                                                    </div>
                                                </div>
                                                `);
                                            }
                                        }
                                    });

                                    clearInterval(increamtsappgame);
                                    gamegenerate(); // Restart the game
                                } else {
                                    a = parseFloat(a) + 0.01; // Incrementing a
                                    incrementor(parseFloat(a).toFixed(2));

                                    // Calculate exponential delay based on the current value of 'a'
                                    let intervalDelay = Math.max(100 * Math.pow(0.7, a - 1), 5); // Minimum delay of 10ms

                                    clearInterval(increamtsappgame); // Clear previous interval
                                    increamtsappgame = setInterval(incrementGame, intervalDelay); // Restart with new delay
                                }
                            };

                            // Start the interval
                            increamtsappgame = setInterval(incrementGame, 100); // Start with an initial delay
                        }
                    });
                }
            });
        }, 5000);
    }, 1500);
}
