            bet_array.splice(0, 1); // Remove Perticular Bet
        } else {
            bet_array.splice(1, 1); // Remove Perticular Bet
        }
    } else if (bet_array.length == 2 && section_no == 1) {
        if (bet_array[0].section_no == 1) {
