let lastActivationTime = 0;
function incrementor(inc_no) {
    const now = new Date().getTime();
    inc_no = parseFloat(inc_no); 
    const timeSinceLastActivation = now - lastActivationTime;

    if (timeSinceLastActivation > 700) {  // 0.5 seconds
        lastActivationTime = now;

        // Select only list items that do not have the class 'active'
        let listItems = $('.list-items').not('.active');

        if (listItems.length > 0) {
            let randomIndex = Math.floor(Math.random() * listItems.length);
            let randomUser = listItems.eq(randomIndex);

            let amountText = randomUser.find('.column-2').text(); // Get the text from column-1
            let amount = parseFloat(amountText.replace(/[^0-9.-]+/g,"")); // Clean the string and convert to float

            // Add the 'active' class to the selected item
            randomUser.addClass('active');
            randomUser.find('.column-3').html(inc_no.toFixed(2) + 'x');
            randomUser.find('.column-4').html(currency_symbol + (inc_no * amount).toFixed(0));
        }
    }

    $('.loading-game').removeClass('show');
    $("#auto_increment_number_div").show();
    $("#running_type").text('cash out time');
    document.getElementById('auto_increment_number').innerText = inc_no + 'x';

    // Other game logic (cashout, etc.)
    if (bet_array.length > 0) {
        let main_isChecked = $('#main_checkout').prop('checked');
        let extra_isChecked = $("#extra_checkout").prop('checked');

        for (let i = 0; i < bet_array.length; i++) {
            let multiplier;
            let section = bet_array[i].section_no == 0 ? '#main_incrementor' : '#extra_incrementor';

            multiplier = $(section).val();

            // If the current multiplier reaches the user's bet multiplier
            if (parseFloat(inc_no) >= parseFloat(multiplier)) {
                if (bet_array[i].is_bet == 1) {
                    if (bet_array[i].section_no == 0 && main_isChecked) {
                        if (main_counter == 0) {
                            cash_out_now('', 0, multiplier);
                            main_counter++;
                            main_cash_out = 1;
                        }
                    } else if (bet_array[i].section_no == 1 && extra_isChecked) {
                        if (extra_counter == 0) {
                            cash_out_now('', 1, multiplier);
                            extra_counter++;
                            extra_cash_out = 1;
                        }
                    }
                }
            }
        }
    }

    if (bet_array.length > 0) {
        cash_out_multiplier(inc_no);
    }
}




