"""
Development server with simple in-memory game logic for the crash game.

Features:
- Serves static files from the project directory (this file's folder by default)
- Uses crash.html as the default root page if present
- Disables caching for easier development
- Implements minimal API endpoints used by the front-end JS:
  POST  /game/new_game_generated   -> start a new round
  POST  /game/increamentor         -> get the target multiplier for the current round
  POST  /game/currentlybet         -> get current round bets/summary
  POST  /game/add_bet              -> add player's bet(s) for current round
  POST  /game/my_bets_history      -> get player's bet history
  POST  /game/currentid            -> get current round id
  POST  /game/game_over            -> finalize server-side state after crash
  POST  /previous_game_bet_list    -> get previous round result and bets
  POST  /member_bet                -> paginated member bet history (stub)
  POST  /is_login                  -> always true (stub)
  GET   /cash_out                  -> cash out a bet

Notes:
- This is a lightweight, in-memory simulation designed for local development.
  It is not intended for production use and has no persistence.

Usage examples:
  python server.py
  python server.py -p 8080
  python server.py -H 0.0.0.0 -p 8000 --dir .
  python server.py --open

Then visit:
  http://127.0.0.1:8000/

Stop with Ctrl+C.
