import argparse
import contextlib
import json
import mimetypes
import os
import random
import sys
import threading
import time
import urllib.parse as urlparse
import webbrowser
from functools import partial

try:
    # Python 3.7+
    from http.server import SimpleHTTPRequestHandler, ThreadingHTTPServer
