    from http.server import SimpleHTTPRequestHandler, HTTPServer as ThreadingHTTPServer  # type: ignore

# Ensure common MIME types (Windows sometimes misreports)
mimetypes.add_type('application/javascript', '.js')
mimetypes.add_type('text/css', '.css')


# ------------------------------
# In-memory game state
# ------------------------------
class GameState:
    def __init__(self):
        self._lock = threading.Lock()
        self._next_round_id = int(time.time())  # start with epoch-based id
        self._next_bet_id = 1
        self.current_round = None  # dict with keys: id, max_multiplier, bets, started
        self.previous_round = None  # last finished round with win_multi and bets
        self.member_balances = {}  # token/hash -> balance (float)
        self.member_histories = {}  # token/hash -> list of bet history entries

    # Utility helpers
    def _new_round_id(self) -> int:
        rid = self._next_round_id
        self._next_round_id += 1
        return rid

    def _new_bet_id(self) -> int:
        bid = self._next_bet_id
        self._next_bet_id += 1
        return bid

    def _ensure_member(self, token: str):
        # Initialize balance and history for a member token
        if token not in self.member_balances:
            self.member_balances[token] = 0.0
        if token not in self.member_histories:
            self.member_histories[token] = []

    def new_round(self) -> dict:
        with self._lock:
            # Move current to previous when starting a new one
            if self.current_round is not None:
                # If current round hasn't been finalized, mark it as crashed at target
                if 'win_multi' not in self.current_round:
                    self.current_round['win_multi'] = float(self.current_round['max_multiplier'])
                self.previous_round = self.current_round

            rid = self._new_round_id()
            # Random target multiplier similar to crash games
            # Heavier weight around 1-3x, with rare spikes up to ~15x
            base = random.random()
            if base < 0.80:
                target = round(random.uniform(1.01, 3.5), 2)
            elif base < 0.95:
                target = round(random.uniform(3.5, 8.0), 2)
            else:
                target = round(random.uniform(8.0, 15.0), 2)

            self.current_round = {
                'id': rid,
                'max_multiplier': float(target),
                'bets': [],  # list of dicts: bet_id, token, amount, section_no, cashout_multiplier, created_at
                'started': time.time(),
            }
            return dict(self.current_round)

    def get_current_round(self) -> dict | None:
        with self._lock:
            return None if self.current_round is None else dict(self.current_round)

    def add_bets(self, token: str, bets: list[dict]) -> list[dict]:
        now = time.time()
        with self._lock:
            self._ensure_member(token)
            if self.current_round is None:
                # Auto-start a round if none exists
                self.new_round()
            created = []
            for b in bets:
                try:
                    amount = float(b.get('bet_amount') or b.get('amount') or 0)
                except Exception:
                    amount = 0.0
                section_no = int(b.get('section_no') or 0)
                bet_type = int(b.get('bet_type') or 0)
                bet = {
                    'bet_id': self._new_bet_id(),
                    'token': token,
                    'amount': amount,
                    'section_no': section_no,
                    'bet_type': bet_type,
                    'cashout_multiplier': 0.0,
                    'created_at': now,
                    # UI helpers
                    'image': 'images/step-03.png',  # local placeholder
                    'userid': f"u****{random.choice('abcdefghijklmnopqrstuvwxyz')}",
                }
                self.current_round['bets'].append(bet)
                created.append(bet)
                # Deduct amount from balance
                self.member_balances[token] -= amount
            return created

    def cash_out(self, bet_id: int, win_multiplier: float) -> dict | None:
        with self._lock:
            if self.current_round is None:
                return None
            # find bet
            bet = next((b for b in self.current_round['bets'] if int(b['bet_id']) == int(bet_id)), None)
            if not bet:
                # Allow cashout from previous round if still present
                if self.previous_round is not None:
                    bet = next((b for b in self.previous_round.get('bets', []) if int(b['bet_id']) == int(bet_id)), None)
                    if not bet:
                        return None
                else:
                    return None
            if bet['cashout_multiplier'] > 0:
                # already cashed
                return bet
            bet['cashout_multiplier'] = float(win_multiplier)
            token = bet['token']
            self._ensure_member(token)
            payout = float(bet['amount']) * float(win_multiplier)
            self.member_balances[token] += payout
            # push into history entry
            self.member_histories[token].append({
                'created_at': bet['created_at'],
                'amount': bet['amount'],
                'cashout_multiplier': bet['cashout_multiplier'],
                'round_id': self.current_round['id'] if self.current_round else None,
                'payout': payout,
            })
            return {
                'bet': bet,
                'wallet_balance': self.member_balances[token],
                'cash_out_amount': round(payout, 2),
            }

    def game_over(self, token: str, crashed_at: float | None) -> float:
        with self._lock:
            if self.current_round is None:
                # nothing to do
                return self.member_balances.get(token, 0.0)
            # finalize round, mark win multiplier
            if crashed_at is None:
                crashed_at = float(self.current_round['max_multiplier'])
            self.current_round['win_multi'] = float(crashed_at)

            # For any remaining bets without cashout, record as loss in history
            for bet in self.current_round['bets']:
                if bet['cashout_multiplier'] <= 0:
                    t = bet['token']
                    self._ensure_member(t)
                    self.member_histories[t].append({
                        'created_at': bet['created_at'],
                        'amount': bet['amount'],
                        'cashout_multiplier': 0.0,
                        'round_id': self.current_round['id'],
                        'payout': 0.0,
                    })
            # rotate to previous
            self.previous_round = self.current_round
            self.current_round = None
            return self.member_balances.get(token, 0.0)

    def current_bets_summary(self) -> dict:
        with self._lock:
            if self.current_round is None:
                return {
                    'currentGame': None,
                    'currentGameBetCount': 0,
                    'currentGameBet': [],
                }
            # map to UI expected structure
            mapped = []
            for b in self.current_round['bets']:
                mapped.append({
                    'userid': b['userid'],
                    'amount': b['amount'],
                    'cashout_multiplier': b['cashout_multiplier'],
                    'image': b['image'],
                    # Optionally include a class_name to allow highlighting in UI
                    # 'class_name': f"{b['token'][-5:]}{b['section_no']}",
                })
            return {
                'currentGame': {'id': self.current_round['id']},
                'currentGameBetCount': len(self.current_round['bets']),
                'currentGameBet': mapped,
            }

    def previous_round_summary(self) -> dict | None:
        with self._lock:
            if not self.previous_round:
                return None
            mapped = []
            for b in self.previous_round.get('bets', []):
                mapped.append({
                    'userid': b['userid'],
                    'amount': b['amount'],
                    'cashout_multiplier': b['cashout_multiplier'],
                    'image': b['image'],
                })
            return {
                'bet_list': mapped,
                'bet_counts': len(mapped),
                'win_multi': float(self.previous_round.get('win_multi', 0.0)),
            }

    def member_history(self, token: str) -> list[dict]:
        with self._lock:
            self._ensure_member(token)
            # Return newest first
            out = []
            for item in reversed(self.member_histories[token]):
                out.append({
                    'created_at': time.strftime('%Y-%m-%dT%H:%M:%S', time.localtime(item['created_at'])),
                    'amount': item['amount'],
                    'cashout_multiplier': item['cashout_multiplier'],
                })
            return out

    def member_bet_paged(self, token: str, offset: int, limit: int = 10) -> list[dict]:
        with self._lock:
            self._ensure_member(token)
            hist = list(reversed(self.member_histories[token]))
            page = hist[offset: offset + limit]
            rows = []
            for h in page:
                rows.append({
                    'date': time.strftime('%H:%M', time.localtime(h['created_at'])),
                    'multiplication': h['cashout_multiplier'],
                    'bet_amount': h['amount'],
                    'cash_out_amount': round(h['amount'] * h['cashout_multiplier'], 2) if h['cashout_multiplier'] > 0 else 0,
                })
            return rows


