# ------------------------------
# HTTP Handler
# ------------------------------
class DevRequestHandler(SimpleHTTPRequestHandler):
    """A request handler with no-cache headers, default root page, and API endpoints."""

    # Default file to serve at '/'
    default_file = 'crash.html'

    def __init__(self, *args, directory=None, **kwargs):
        # Remember the served directory for path checks
        self._served_dir = os.path.abspath(directory or os.getcwd())
        super().__init__(*args, directory=directory, **kwargs)

    def end_headers(self):
        # Disable caching for dev convenience
        self.send_header('Cache-Control', 'no-cache, no-store, must-revalidate')
        self.send_header('Pragma', 'no-cache')
        self.send_header('Expires', '0')
        super().end_headers()

    def _json(self, obj: dict | list, status: int = 200):
        data = json.dumps(obj).encode('utf-8')
        self.send_response(status)
        self.send_header('Content-Type', 'application/json; charset=utf-8')
        self.send_header('Content-Length', str(len(data)))
        self.end_headers()
        self.wfile.write(data)

    def _text(self, text: str, status: int = 200):
        data = text.encode('utf-8')
        self.send_response(status)
        self.send_header('Content-Type', 'text/plain; charset=utf-8')
        self.send_header('Content-Length', str(len(data)))
        self.end_headers()
        self.wfile.write(data)

    def _parse_body(self) -> dict:
        length = int(self.headers.get('Content-Length', '0') or 0)
        raw = self.rfile.read(length) if length > 0 else b''
        ctype = (self.headers.get('Content-Type') or '').lower()
        if 'application/json' in ctype:
            try:
                return json.loads(raw.decode('utf-8') or '{}')
            except Exception:
                return {}
        # default: form-urlencoded
        try:
            parsed = urlparse.parse_qs(raw.decode('utf-8'))
        except Exception:
            return {}
        flat = {k: v[0] if isinstance(v, list) and len(v) == 1 else v for k, v in parsed.items()}
        # Attempt to reconstruct all_bets if sent as nested form fields like all_bets[0][bet_amount]
        grouped: dict[int, dict] = {}
        for key, value in flat.items():
            if key.startswith('all_bets['):
                # pattern: all_bets[<idx>][<field>]
                try:
                    idx_str = key.split('[', 1)[1].split(']', 1)[0]
                    rest = key.split(']', 1)[1]
                    field = rest.strip('[]') if rest else ''
                    idx = int(idx_str)
                except Exception:
                    continue
                grouped.setdefault(idx, {})
                if field:
                    grouped[idx][field] = value
        if grouped:
            flat['all_bets'] = [grouped[i] for i in sorted(grouped.keys())]
        return flat

    # --------------------------
    # GET routing
    # --------------------------
    def do_GET(self):
        parsed = urlparse.urlparse(self.path)
        path = parsed.path

        # Map root to default file if present
        if path in ('', '/', '/index.html'):
            candidate = os.path.join(self._served_dir, self.default_file)
            if os.path.exists(candidate):
                self.path = '/' + self.default_file
                return super().do_GET()

        # API: cash out (GET to support legacy JS)
        if path == '/cash_out':
            qs = urlparse.parse_qs(parsed.query)
            bet_id = int((qs.get('bet_id') or ['0'])[0])
            win_multiplier = float((qs.get('win_multiplier') or ['0'])[0])
            token = 'local-dev'  # use token-less identity
            result = STATE.cash_out(bet_id, win_multiplier)
            if result is None:
                return self._json({'isSuccess': False, 'message': 'Bet not found'}, 404)
            return self._json({'isSuccess': True, 'data': result})

        # Fallback to static files
        return super().do_GET()

    # --------------------------
    # POST routing
    # --------------------------
    def do_POST(self):
        parsed = urlparse.urlparse(self.path)
        path = parsed.path
        body = self._parse_body()

        # Token from front-end (not validated here). Use as member id for isolation.
        token = str(body.get('_token') or 'local-dev')

        # /game/new_game_generated -> start a new round
        if path == '/game/new_game_generated':
            rnd = STATE.new_round()
            return self._json({'id': rnd['id']})

        # /game/increamentor -> return current round target multiplier
        if path == '/game/increamentor':
            rnd = STATE.get_current_round()
            if rnd is None:
                rnd = STATE.new_round()
            return self._json({'result': float(rnd['max_multiplier'])})

        # /game/currentlybet -> summary of current bets
        if path == '/game/currentlybet':
            return self._json(STATE.current_bets_summary())

        # /game/add_bet -> accept 1 or 2 bets
        if path == '/game/add_bet':
            all_bets = body.get('all_bets') or []
            # If client sent JSON string for bets, parse it
            if isinstance(all_bets, str):
                try:
                    all_bets = json.loads(all_bets)
                except Exception:
                    all_bets = []
            if not isinstance(all_bets, list):
                all_bets = []
            created = STATE.add_bets(token, all_bets)
            ret = {
                'isSuccess': True,
                'data': {
                    'wallet_balance': round(STATE.member_balances.get(token, 0.0), 2),
                    'return_bets': [{'bet_id': b['bet_id']} for b in created],
                }
            }
            return self._json(ret)

        # /game/my_bets_history -> return member history
        if path == '/game/my_bets_history':
            return self._json(STATE.member_history(token))

        # /game/currentid -> return current round id (stub)
        if path == '/game/currentid':
            rnd = STATE.get_current_round() or STATE.new_round()
            return self._json({'id': rnd['id']})

        # /game/game_over -> finalize round at the provided multiplier
        if path == '/game/game_over':
            last_time = body.get('last_time')
            try:
                crashed_at = float(last_time) if last_time is not None else None
            except Exception:
                crashed_at = None
            bal = STATE.game_over(token, crashed_at)
            # This endpoint expects text (balance)
            return self._text(str(round(bal, 2)))

        # previous round data (legacy paths without /game prefix in some JS)
        if path == '/previous_game_bet_list':
            prev = STATE.previous_round_summary()
            if not prev:
                return self._json({'isSuccess': False, 'data': {}}, 200)
            return self._json({'isSuccess': True, 'data': prev})

        # member bet history pagination (legacy path)
        if path == '/member_bet':
            try:
                offset = int(body.get('offset') or 0)
            except Exception:
                offset = 0
            rows = STATE.member_bet_paged(token, offset, limit=10)
            return self._json({'isSuccess': True, 'data': rows})

        # is_login (legacy path) -> always true
        if path == '/is_login':
            return self._json({'isSuccess': True})

        # Unknown API -> 404
        return self._json({'error': 'Not Found', 'path': path}, 404)

    def log_message(self, format, *args):  # noqa: A003 - override name from base class
        # Quiet, consistent logging
        sys.stderr.write("[dev-server] %s - - %s\n" % (self.address_string(), format % args))


# ------------------------------
# CLI helpers
# ------------------------------

def resolve_directory(dir_arg: str) -> str:
    if os.path.isabs(dir_arg):
        return dir_arg
    # Serve from the directory containing this script when not absolute
    base = os.path.dirname(os.path.abspath(__file__))
    return os.path.abspath(os.path.join(base, dir_arg))


def parse_args(argv=None):
    parser = argparse.ArgumentParser(description='Simple development static file server with game logic')
    parser.add_argument('-p', '--port', type=int, default=int(os.environ.get('PORT', 8000)), help='Port to bind (default: 8000)')
    parser.add_argument('-H', '--host', default=os.environ.get('HOST', '127.0.0.1'), help='Host to bind (default: 127.0.0.1)')
    parser.add_argument('--dir', default='.', help='Directory to serve (default: script directory)')
    parser.add_argument('--open', action='store_true', help='Open the site in your default browser after starting')
    return parser.parse_args(argv)


def main(argv=None) -> int:
    args = parse_args(argv)

    serve_dir = resolve_directory(args.dir)
    if not os.path.isdir(serve_dir):
        sys.stderr.write(f"Error: directory not found: {serve_dir}\n")
        return 1

    handler_cls = partial(DevRequestHandler, directory=serve_dir)

    try:
        httpd = ThreadingHTTPServer((args.host, args.port), handler_cls)
    except OSError as e:
        sys.stderr.write(f"Failed to bind {args.host}:{args.port} -> {e}\n")
        return 1

    url = f"http://{args.host}:{args.port}/"
    print(f"Serving '{serve_dir}' at {url}")
    print("Default root file:", getattr(DevRequestHandler, 'default_file', 'index.html'))
    print("Press Ctrl+C to stop.")

    with contextlib.ExitStack() as stack:
        stack.callback(httpd.server_close)
        if args.open:
            # Delay open very slightly to ensure bind is ready
            try:
                webbrowser.open(url)
            except Exception as e:  # pragma: no cover
                print(f"Failed to open browser: {e}")
        try:
            httpd.serve_forever(poll_interval=0.5)
        except KeyboardInterrupt:
            print("\nShutting down...")
        finally:
            # Ensure sockets are released
            httpd.shutdown()
    return 0


if __name__ == '__main__':
    raise SystemExit(main())
